function getConvertedData(layer) {
  const data = layer.data;
  const column = layer.width;
  const row = layer.height;

  const positions = [];

  let i = 0;
  for (let r = 0; r < row; ++r) {
    for (let c = 0; c < column; ++c) {
      if (data[i] !== 0) {
        positions.push({ x: c, y: r });
      }

      ++i;
    }
  }

  return positions;
}
